import React from 'react'

const Social = () => {
    return (
        <div className="social">
                <a href="https://www.facebook.com/phuketcampus/" target="_blank" rel="noopender noreferrer"><i class="fab fa-facebook-square"></i></a>
            </div>
    )
}

export default Social;
